                name='name'
                placeholder='Movie Title'
                />
                <button
                onClick={() => this.getMovies()}
                >Search</button>
                <Results 
                name= {this.state.SampleData.name}
                image={this.state.SampleData.image}/>
            </div>
        )
    }
}
